    "2015-09-01T18:17:08.248673",nt"name": "measuring-the-effect-of-snap-participation-on-food-security",nt"isopen":
    true,nt"url": null,nt"notes": "SNAP is designed to reduce food insecurity
    u2013 reduced food intake or disrupted eating patterns in a household due to lack
    of money or other resources u2013 but data quantifying this effect is limited. The
    objectives of this study were to: Assess how food security and food expenditures
    vary with SNAP participation. Examine how relationships between SNAP and food security
    and between SNAP and food expenditures vary by household characteristics and circumstances.
    Estimating the effect of SNAP on food insecurity using household survey data is
    challenging because households that choose to participate in SNAP can differ in
    systematic ways from households that do not participate, making it hard to distinguish
    the impact of SNAP from these other factors. This study sought to control for the
    SNAP participation u201cselection biasu201d by comparing information collected from
    households within days of entering the program (new entrants) to information obtained
    after about 6 months of participation.",nt"license_title": "Creative Commons
